import React from 'react';
import logo from '../logo.svg';

class Body extends React.Component{

    constructor(props){
        super(props);
        this.user = this.props.userDetails;
        var add = this.props.userDetails.address;
    }
    
    

    render(){
        

        return(
            <div>
                <img src={logo} className="App-logo" alt="logo" /> <br/>
                <ul>
                    <li> <b> First Name: </b> {props.userDetails.firstName}  </li>
                    <li> <b> Last Name: </b> {user.lastName}  </li>
                    <li> <b> Location: </b> {user.location}  </li>

                    <li> <b> City: </b> {add.city}  </li>
                    <li> <b> Pincode: </b> {add.pincode}  </li>
            
                </ul>
                <button className="btn btn-primary">On</button>
            </div>
        );
    }
}


export default Body;
